import React, { useState } from 'react';
import Form from '../Form'
import './Climb.css';


const Climb = ({climbList}) => {
    const[values, setValues] = useState({
        gym: 'Gym',
        climbType: 'Type',
        grade: 'Grade',
        rating: 'Rating',
    })

    return (

        <div className="climb-container">   
            <div className='climb-item'>
                {values.climbType}
            </div>
            <div className='climb-item'>
                {values.gym}
            </div>
            <div className='climb-item'>
                {values.grade}
            </div>
            <div className='climb-item'>
                {values.rating}
            </div>
        </div>
    );
}

export default Climb;
